column8:
有田焼の本元「佐賀県有田」より直接仕入れました。とってもきれいで、品のあるストラップ<br><br>※ サイズ:約10cm<BR>
<BR><font color="#ff0000"><b>※ ストラップ部分の紐の色は、アソートになります。(いろいろあります。)</font></b><br><br><br><br><br>
<FONT color="#ff9900"><B><U><FONT size="4" color="#ff8000">まだまだあります！有田焼ストラップ一覧はこちら♪</FONT></U></B></FONT><style type="text/css">
span.choice{
	display: inline-block;
